import React, { Component } from "react";
import {Link} from 'react-router-dom';

export class MenuList extends Component {
  render() {

    let location = window.location.href.split('/')[window.location.href.split('/').length - 2];

    console.log(location);

    const dashboardClass = location === "/dashboard" ? "btn w-100 text-left check-hover py-3 bg-transparent btn-secondary" : "btn w-100 text-left check-hover py-3 bg-transparent router-link-exact-active router-link-active btn-secondary";

    const evestClass = location === "/dashboard" ? "btn w-100 text-left check-hover py-3 bg-transparent btn-secondary" : "btn w-100 text-left check-hover py-3 bg-transparent router-link-exact-active router-link-active btn-secondary"; 


    const landvestClass = location === "/dashboard" ? "btn w-100 text-left check-hover py-3 bg-transparent btn-secondary" : "btn w-100 text-left check-hover py-3 bg-transparent router-link-exact-active router-link-active btn-secondary"; 


    const plansClass = location === "/dashboard" ? "btn w-100 text-left check-hover py-3 bg-transparent btn-secondary" : "btn w-100 text-left check-hover py-3 bg-transparent router-link-exact-active router-link-active btn-secondary"; 


    const accountClass = location === "/dashboard" ? "btn w-100 text-left check-hover py-3 bg-transparent btn-secondary" : "btn w-100 text-left check-hover py-3 bg-transparent router-link-exact-active router-link-active btn-secondary"; 


    return (
      <div>
        <ul className="list-unstyled">
          <li>
            <Link
              to="/dashboard"
              className={dashboardClass}
            >
              <i className="mr-1 ti-dashboard"></i> Dashboard
            </Link>
          </li>
          <li>
            <Link
              to="/evest"
              className={evestClass}
            >
              <i className="mr-1 ti-home"></i> EVest
              <span className="badge badge-primary ml-2">Hot🔥</span>
            </Link>
          </li>
          <li>
            <Link
              to="/evest"
              className={landvestClass}
            >
              <i className="mr-1 ti-map"></i> LandVest
              <span className="badge badge-primary ml-2"> Hot🔥</span>
            </Link>
          </li>
          <li>
            <Link
              to="/my-plans"
              className={plansClass}
            >
              <i className="mr-1 ti-credit-card"></i> My Plans
            </Link>
          </li>
          <li>
            <Link
              to="/my-account"
              className={accountClass}
            >
              <i className="mr-1 ti-user"></i> My Account
            </Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default MenuList;
